// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;

import "@uniswap/v3-core/contracts/libraries/TickMath.sol";
import "@uniswap/v3-core/contracts/libraries/FullMath.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

contract Util {
    using SafeERC20 for IERC20;

    function getParam(
        address _uniFactory,
        address _poolAddress,
        address _config,
        address _nftManager,
        address _operator,
        address _swapPool,
        uint8 _performanceFee,
        uint24 _diffTick
    ) external pure returns (bytes memory param) {
        bytes4 methodId = bytes4(
            keccak256(
                "initialize(address,address,address,address,address,address,uint8,uint24)"
            )
        );
        param = abi.encodeWithSelector(
            methodId,
            _uniFactory,
            _poolAddress,
            _config,
            _nftManager,
            _operator,
            _swapPool,
            _performanceFee,
            _diffTick
        );
    }

    function getPairParam(
        address _operator,
        address _poolAddress,
        address _config,
        address _nftManager
    ) external pure returns (bytes memory param) {
        bytes4 methodId = bytes4(
            keccak256("initialize(address,address,address,address)")
        );
        param = abi.encodeWithSelector(
            methodId,
            _operator,
            _poolAddress,
            _config,
            _nftManager
        );
    }

    function getParam2(
        address _uniFactory,
        address _poolAddress,
        address _config,
        address _nftManager,
        address _operator,
        address _swapPool,
        uint8 _performanceFee,
        uint24 _diffTick
    ) external pure returns (bytes memory param) {
        param = abi.encodeWithSignature(
            "initialize(address,address,address,address,address,address,uint8,uint24)",
            _uniFactory,
            _poolAddress,
            _config,
            _nftManager,
            _operator,
            _swapPool,
            _performanceFee,
            _diffTick
        );
    }

    function getUpgradeParam(address _vaultAddress)
        external
        pure
        returns (bytes memory param)
    {
        bytes4 methodId = bytes4(keccak256("upgrade(address)"));
        param = abi.encodeWithSelector(methodId, _vaultAddress);
    }

    function getSenderAddress() external view returns (address) {
        return msg.sender;
    }

    function getSqrtRatioAtTick(int24 tick) external pure returns (uint160) {
        return TickMath.getSqrtRatioAtTick(tick);
    }

    function getGasCostOfGetSqrtRatioAtTick(int24 tick)
        external
        view
        returns (uint256)
    {
        uint256 gasBefore = gasleft();
        TickMath.getSqrtRatioAtTick(tick);
        return gasBefore - gasleft();
    }

    function getTickAtSqrtRatio(uint160 sqrtPriceX96)
        external
        pure
        returns (int24)
    {
        return TickMath.getTickAtSqrtRatio(sqrtPriceX96);
    }

    function getGasCostOfGetTickAtSqrtRatio(uint160 sqrtPriceX96)
        external
        view
        returns (uint256)
    {
        uint256 gasBefore = gasleft();
        TickMath.getTickAtSqrtRatio(sqrtPriceX96);
        return gasBefore - gasleft();
    }

    function MIN_SQRT_RATIO() external pure returns (uint160) {
        return TickMath.MIN_SQRT_RATIO;
    }

    function MAX_SQRT_RATIO() external pure returns (uint160) {
        return TickMath.MAX_SQRT_RATIO;
    }

    function mulDiv(
        uint256 a,
        uint256 b,
        uint256 c
    ) external pure returns (uint256) {
        return FullMath.mulDiv(a, b, c);
    }

    function swap(
        address swapPool,
        bool zeroForOne,
        uint256 _amountIn,
        address to,
        int24 targetTick
    ) external returns (int256 amount0, int256 amount1) {
        //根据希望打到的tick计算sqrtPriceLimitX96
        uint160 sqrtPriceLimitX96 = TickMath.getSqrtRatioAtTick(targetTick);
        (amount0, amount1) = IUniswapV3Pool(swapPool).swap(
            to,
            zeroForOne,
            int256(_amountIn),
            sqrtPriceLimitX96,
            ""
        );
    }

    function uniswapV3SwapCallback(
        int256 amount0Delta,
        int256 amount1Delta,
        bytes calldata
    ) external {
        require(amount0Delta > 0 || amount1Delta > 0, "Zero");
        IUniswapV3Pool pool = IUniswapV3Pool(msg.sender);
        if (amount0Delta > 0) {
            IERC20(pool.token0()).safeTransferFrom(
                tx.origin,
                msg.sender,
                uint256(amount0Delta)
            );
        }
        if (amount1Delta > 0) {
            IERC20(pool.token1()).safeTransferFrom(
                tx.origin,
                msg.sender,
                uint256(amount1Delta)
            );
        }
    }
}
